import logo from './logo.svg';
import './App.css';
import React, {Component} from 'react';

class App extends React.Component{
  render(){
  return (
    <>
      <div className="App-header">
        <div className="child1">
          <div className="countingResult">0</div>
          <hr />
          <div className="buttons">
            <button className="positiveButton">Increase</button>
            <button className="negativeButton">Decrease</button>
          </div>
        </div>
      </div>
    </>
  );
}
}

export default App;
